// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import ProductForm from './components/ProductForm';
import ClientForm from './components/ClientForm';
import UserForm from './components/UserForm';
import SaleForm from './components/SaleForm';
import PurchaseForm from './components/PurchaseForm';
import CategoryForm from './components/CategoryForm';

function App() {
  const handleFormSubmit = (data) => {
    console.log('Form data submitted:', data);
    // Vous pouvez ajouter ici la logique pour enregistrer les données
  };

  return (
    <Router>
      <div>
        <h1>Point de Vente</h1>
        <Routes>
          <Route path="/add-product" element={<ProductForm onSubmit={handleFormSubmit} />} />
          <Route path="/add-client" element={<ClientForm onSubmit={handleFormSubmit} />} />
          <Route path="/add-user" element={<UserForm onSubmit={handleFormSubmit} />} />
          <Route path="/add-sale" element={<SaleForm onSubmit={handleFormSubmit} />} />
          <Route path="/add-purchase" element={<PurchaseForm onSubmit={handleFormSubmit} />} />
          <Route path="/add-category" element={<CategoryForm onSubmit={handleFormSubmit} />} />
          {/* Ajoutez d'autres routes si nécessaire */}
        </Routes>
      </div>
    </Router>
  );
}

export default App;
